import React, { Component } from "react"

export default class MenuItens extends Component{

    render() {
        return(
            <div class="menuItensEdicao">
                <div className="itemEdicao">Slider</div>
                <div className="itemEdicao">Ícones</div>
                <div className="itemEdicao">Quem Somos</div>
                <div className="itemEdicao">Missão e valores</div>
                <div className="itemEdicao">Depoimentos</div>
                <div className="itemEdicao">Parceiros</div>
                <div className="itemEdicao">Contato</div>
            </div>
        )
    }
}
